descript.abstract:
The United States (US) Navy proposed constructing an Undersea Warfare Training Range (USWTR) along the US Atlantic coast. One of the proposed sites within the Cherry Point (CHPT) OPAREA is an area of 1,713 km2 in Onslow Bay, 87 km from the coast of North Carolina. As part of the Navy's Atlantic Fleet Training and Testing (AFTT) Monitoring Program, shipboard and aerial line transect surveys were implemented in 2007 to estimate density and document distribution and seasonal residency of marine mammals and sea turtles in the proposed USWTR (see <a href=http://seamap.env.duke.edu/datasets/detail/433>"DUML vessel-based line transect surveys for proposed Onslow Bay USWTR site 2007-2010"</a> dataset). Shipboard line-transect survey methods transitioned to biopsy and photo-identification sampling at the end of April 2011 to address questions of residency and population structure in the CHPT OPAREA. Survey effort was expended along the 200 m depth contour and occasionally around eddies and fronts generated by the Gulf Stream. We are focusing on residency and population structure with our shipboard surveys because we are: 
(1) obtaining adequate data with which to estimate density from aerial line transect sampling;
(2) interested in addressing questions of residency as photo-identification data from Onslow suggest considerable residency in that area despite minimal sampling. Sightings within this dataset are from shipboard photo-ID and biopsy surveys conducted from 2011-2013.
